import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { getIpAddressTracker } from "../../features/ipAddressTrackerSlice/ipAddressTrackerSlice";

export const AddressTrackerComponent = () => {
  const dispatch = useDispatch();
  const addressTracker = useSelector((state) => state.addressTracker);

  const handleSubmitSearchAddress = (e) => {
    dispatch(getIpAddressTracker(e.target.value));
  };
  const handleChangeSearchAddress = (e) => {
    console.log(e.target.value, "<---input");
  };
  useEffect(() => {
    dispatch(getIpAddressTracker("185.233.24.233"));
  });

  console.log(addressTracker, "<--- address tracker redux");
  return (
    <div>
      <form onSubmit={handleSubmitSearchAddress}>
        <input type="text" onChange={handleChangeSearchAddress} />
      </form>
    </div>
  );
};
